import React, { useState, useEffect } from "react";
import Home from "./Pages/Home.js";
import Contact from "./Pages/Contact.js"
import NotFound from "./Pages/NotFound.js";
import Login from "./Pages/Login.js";
import Register from "./Pages/Register.js";
import Dashboard from "./components/Dashboard.js";
import Shop from "./Pages/Shop.js";
import { serverDomain } from './credentials.js';


import "./Style.css";
import { BrowserRouter, Route, Routes, exact } from "react-router-dom";
import ProductsArchive from "./components/ProductsArchive.js";
import axios from "axios";

export default function app() {
  const [categories, setCategories]= useState([])
  const getCategories = ()=>{
    axios({
      url: `${serverDomain}/category/view/`,
      method: "post",
      data: {

      }
    }).then((res)=>{
      setCategories(res.data)
    }).catch((err)=>{
      setMessage("There is an error fetching data, plesse try again later")
    })
  }
  useEffect(()=>{
    getCategories()
  })

  return (
    <>
      <BrowserRouter>
      <Routes>
            <Route exact  element={<Home/>} path="/"/>
            <Route element={<Home/>} path="/home"/>
            <Route element={<Contact/>} path="/contact"/>
            <Route element={<Login/>} path="/login"/>
            <Route element={<Register/>} path="/register"/>
            <Route element={<Dashboard/>} path="/dashboard"/>
            <Route element={<Shop/>} path="/shop">

              {
                categories.map((item,index)=>{
                  return(
                    <Route key={index} element={<ProductsArchive/>} path={`/shop/category/:name`} />
                  )
                }) 
              }
             
            </Route>
            <Route path="*" element={<NotFound/>}/> 
      </Routes>
    </BrowserRouter>
    </>
  );
}
